import service from "@/utils/request";
export function PopularMovie(data){
 return service.request({ //切记要记得返回
    method:'Get',
    url:'/movie/popular',
    headers: {
    'Content-Type': 'application/json'
  },
    data:data
   // data:data, //左边的data是后台接收的，右边的data是接收的参数，如果两者同名，可以写成一个即可。
});
}
